  \"americas-women-veterans-military-service-history-and-va-benefit-utilization-statistics\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This comprehensive report chronicles the
  history of women in the military and as Veterans, profiles the characteristics of
  women Veterans in 2009, illustrates how women Veterans in 2009 utilized some of
  the major benefits and services offered by the Department of Veterans Affairs (VA),
  and discusses the future of women Veterans in relation to VA. The goal of this report
  is to gain an understanding of who our women Veterans are, how their military service
  affects their post-military lives, and how they can be better served based on these
  insights.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
